import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return ( 
  	<div className="navabar">
        <Link to="/">Home</Link>
        <Link to="/about">About</Link>
    </div>
  );
};
 
 export default Navbar;
